var notificationtray_pc_assistant_statement  = "<p>1. ΧΟΡΗΓΗΣΗ ΑΔΕΙΑΣ ΧΡΗΣΗΣ<br/>Εκτός εάν ορίζεται διαφορετικά στην παρούσα Άδεια Χρήσης Τελικού Χρήστη, μπορείτε να εγκαταστήσετε και να χρησιμοποιείτε ένα αντίγραφο του ΠΡΟΪΟΝΤΟΣ ΛΟΓΙΣΜΙΚΟΥ σε ένα σύστημα υπολογιστή.<br/>Μπορείτε να δημιουργήσετε ένα μόνο αντίγραφο ασφαλείας του τμήματος λογισμικού του ΠΡΟΪΟΝΤΟΣ ΛΟΓΙΣΜΙΚΟΥ μόνο για σκοπούς αρχειοθέτησης.</p><p>2. ΠΕΡΙΟΡΙΣΜΟΙ ΤΗΣ ΑΔΕΙΑΣ ΧΡΗΣΗΣ<br/>Χρήση του ΠΡΟΪΟΝΤΟΣ ΛΟΓΙΣΜΙΚΟΥ σε πολλούς υπολογιστές με κοινή χρήση όλου ή τμήματος του ΠΡΟΪΟΝΤΟΣ ΛΟΓΙΣΜΙΚΟΥ.<br/>Διαγραφή των σημειώσεων πνευματικών δικαιωμάτων σε οποιοδήποτε αντίγραφο του ΠΡΟΪΟΝΤΟΣ ΛΟΓΙΣΜΙΚΟΥ.<br/>Γνωστοποίηση, μεταφορά, παροχή, ενοικίαση ή διαθεσιμότητας με άλλον τρόπο σε οποιαδήποτε μορφή, του ΛΟΓΙΣΜΙΚΟΥ ή οποιουδήποτε τμήματος αυτού, σε τρίτους χωρίς την προηγούμενη συγκατάθεση της HUAWEI.</p><p>3. ΤΟ ΠΡΟΓΡΑΜΜΑ ΠΑΡΑΜΕΝΕΙ ΙΔΙΟΚΤΗΣΙΑ ΤΗΣ HUAWEI<br />Όλα τα δικαιώματα που δεν χορηγούνται συγκεκριμένα σύμφωνα με την παρούσα Άδεια Χρήσης Τελικού Χρήστη, είναι υπό την επιφύλαξη της HUAWEI.</p>";
